<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8"/>
        <title>docsify</title>
        <link rel="icon" href="assets/_media/favicon.ico"/>
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1"/>
        <meta name="description" content="Description"/>
        <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0"/>
        <link rel="stylesheet" href="//unpkg.com/docsify/lib/themes/vue.css"/>
    </head>

    <body>
        <nav>
        </nav>

        <div id="app"></div>
        <script>
            window.$docsify = {
                name: 'docsify',
                repo: 'https://github.com/mayooot/cicd-pipeline',
                auto2top: true,
                maxLevel: 2,
                loadSidebar: true,
                autoHeader: true,
                subMaxLevel: 3,
                search: 'auto',
                coverpage: true,
                onlyCover: true
            };
        </script>
        <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
        <script src="//unpkg.com/docsify/lib/plugins/search.min.js"></script>
        <script src="//unpkg.com/docsify/lib/plugins/zoom-image.min.js"></script>
        <script src="//unpkg.com/docsify-plantuml/dist/docsify-plantuml.min.js"></script>
        <script src="//unpkg.com/docsify-copy-code"></script>
        <script src="//unpkg.com/prismjs/components/prism-bash.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-java.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-markdown.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-groovy.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-json.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-less.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-yaml.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-docker.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-scala.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-sql.min.js"></script>
        <script src="//unpkg.com/prismjs/components/prism-properties.min.js"></script>
    </body>
</html>
